import React from 'react';

import ImgSenai from '../../assets/images/Logo_SENAI_PRINCIPAL_VERMELHO.png'
import FotoPac from '../../assets/images/fotoPac.png';

import '../../global.css';
import '../header/style.css';


function Header() {
  return (
    <div>
      <nav>
        <div id="header">
          <img id="icone" src={ImgSenai} alt="" />
          <img id="foto" src={FotoPac} alt=""/>
        </div>
          <div id="bottom">
          </div>

      </nav>

    </div>
  );
}

export default Header;
